import React from 'react';

import './videoPlayer.css'

const VideoPlayer = () => {
  const url =
    'https://sigma.stream.voidboost.cc/8543bcf8fb45fd922e2c69a2d1c58673:2023121220:03dd3e49-c7c3-4def-8b5b-b2308cbd9ba6/9/3/8/4/0/7/386co.mp4';
  return (
    <section>
      <video src={url} type="video/mp4" controls />
    </section>
  );
};

export default VideoPlayer;
